#include <iostream>
#include <cassert>

template <typename T>
class Array {
private:
    T* data;
    int size;
    int capacity;
    int grow;

public:
    Array() : data(nullptr), size(0), capacity(0), grow(0) {}

    ~Array() {
        delete[] data;
    }

    int GetSize() const {
        return size;
    }

    void SetSize(int newSize, int newGrow = 1) {
        if (newSize > capacity) {
            int newCapacity = capacity + newGrow;
            T* newData = new T[newCapacity];
            for (int i = 0; i < size; ++i) {
                newData[i] = data[i];
            }
            delete[] data;
            data = newData;
            capacity = newCapacity;
        }
        size = newSize;
    }

    int GetUpperBound() const {
        return size - 1;
    }

    bool IsEmpty() const {
        return size == 0;
    }

    void FreeExtra() {
        if (size < capacity) {
            T* newData = new T[size];
            for (int i = 0; i < size; ++i) {
                newData[i] = data[i];
            }
            delete[] data;
            data = newData;
            capacity = size;
        }
    }

    void RemoveAll() {
        delete[] data;
        data = nullptr;
        size = 0;
        capacity = 0;
    }

    const T& GetAt(int index) const {
        assert(index >= 0 && index < size);
        return data[index];
    }

    void SetAt(int index, const T& value) {
        assert(index >= 0 && index < size);
        data[index] = value;
    }

    const T& operator[](int index) const {
        return GetAt(index);
    }

    T& operator[](int index) {
        return data[index];
    }

    void Add(const T& value) {
        if (size == capacity) {
            SetSize(size + grow);
        }
        data[size] = value;
        size++;
    }

    void Append(const Array<T>& otherArray) {
        int otherSize = otherArray.GetSize();
        if (otherSize > 0) {
            int newSize = size + otherSize;
            SetSize(newSize);
            for (int i = 0; i < otherSize; ++i) {
                data[size + i] = otherArray[i];
            }
        }
    }

    Array<T>& operator=(const Array<T>& otherArray) {
        if (this != &otherArray) {
            delete[] data;
            size = otherArray.GetSize();
            capacity = size;
            data = new T[capacity];
            for (int i = 0; i < size; ++i) {
                data[i] = otherArray[i];
            }
        }
        return *this;
    }

    T* GetData() const {
        return data;
    }

    void InsertAt(int index, const T& value) {
        assert(index >= 0 && index <= size);
        if (size == capacity) {
            SetSize(size + grow);
        }
        for (int i = size; i > index; --i) {
            data[i] = data[i - 1];
        }
        data[index] = value;
        size++;
    }

    void RemoveAt(int index) {
        assert(index >= 0 && index < size);
        for (int i = index; i < size - 1; ++i) {
            data[i] = data[i + 1];
        }
        size--;
    }
};

int main() {
    // Пример использования класса Array

    // Создание и инициализация массива
    Array<int> myArray;
    myArray.SetSize(5, 5);
    for (int i = 0; i < myArray.GetSize(); ++i) {
        myArray[i] = i;
    }

    // Вывод элементов массива
    for (int i = 0; i < myArray.GetSize(); ++i) {
        std::cout << myArray[i] << " ";
    }
    std::cout << std::endl;

    // Изменение размера массива и добавление элементов
    myArray.SetSize(8, 3);
    for (int i = 5; i < myArray.GetSize(); ++i) {
        myArray[i] = i;
    }

    // Вывод элементов массива
    for (int i = 0; i < myArray.GetSize(); ++i) {
        std::cout << myArray[i] << " ";
    }
    std::cout << std::endl;

    // Получение последнего допустимого индекса
    int upperBound = myArray.GetUpperBound();
    std::cout << "Последний допустимый индекс: " << upperBound << std::endl;

    // Проверка, является ли массив пустым
    bool empty = myArray.IsEmpty();
    std::cout << "Массив пустой? " << (empty ? "Да" : "Нет") << std::endl;

    // Удаление "лишней" памяти
    myArray.FreeExtra();

    // Удаление всех элементов массива
    myArray.RemoveAll();

    return 0;
}

#include <iostream>

template <typename T>
T minimum(T a, T b) {
    return (a < b) ? a : b;
}

int main() {
    // Пример использования функции для целых чисел
    int num1 = 10;
    int num2 = 20;
    int minInt = minimum(num1, num2);
    std::cout << "Минимум из " << num1 << " и " << num2 << " : " << minInt << std::endl;

    // Пример использования функции для чисел с плавающей запятой
    double num3 = 3.14;
    double num4 = 2.71;
    double minDouble = minimum(num3, num4);
    std::cout << "Минимум из " << num3 << " и " << num4 << " : " << minDouble << std::endl;

    return 0;
}

#include <iostream>

template <typename T>
T maximum(T a, T b) {
    return (a > b) ? a : b;
}

int main() {
    // Пример использования функции для целых чисел
    int num1 = 10;
    int num2 = 20;
    int maxInt = maximum(num1, num2);
    std::cout << "Максимум из " << num1 << " и " << num2 << " : " << maxInt << std::endl;

    // Пример использования функции для чисел с плавающей запятой
    double num3 = 3.14;
    double num4 = 2.71;
    double maxDouble = maximum(num3, num4);
    std::cout << "Максимум из " << num3 << " и " << num4 << " : " << maxDouble << std::endl;

    return 0;
}

#include <iostream>
#include <cmath>

template <typename T>
void solveLinearEquation(T a, T b) {
    if (a == 0) {
        if (b == 0) {
            std::cout << "Уравнение имеет бесконечное множество решений." << std::endl;
        } else {
            std::cout << "Уравнение не имеет решений." << std::endl;
        }
    } else {
        T x = -b / a;
        std::cout << "Корень линейного уравнения: x = " << x << std::endl;
    }
}

template <typename T>
void solveQuadraticEquation(T a, T b, T c) {
    if (a == 0) {
        solveLinearEquation(b, c);
    } else {
        T discriminant = b * b - 4 * a * c;
        if (discriminant > 0) {
            T x1 = (-b + std::sqrt(discriminant)) / (2 * a);
            T x2 = (-b - std::sqrt(discriminant)) / (2 * a);
            std::cout << "Корни квадратного уравнения: x1 = " << x1 << ", x2 = " << x2 << std::endl;
        } else if (discriminant == 0) {
            T x = -b / (2 * a);
            std::cout << "У квадратного уравнения есть один корень: x = " << x << std::endl;
        } else {
            std::cout << "Квадратное уравнение не имеет действительных корней." << std::endl;
        }
    }
}

int main() {
    // Пример использования функции для линейного уравнения
    double linearA = 2.5;
    double linearB = -7.5;
    solveLinearEquation(linearA, linearB);

    // Пример использования функции для квадратного уравнения
    double quadraticA = 1.0;
    double quadraticB = -3.0;
    double quadraticC = 2.0;
    solveQuadraticEquation(quadraticA, quadraticB, quadraticC);

    return 0;
}

#include <iostream>
#include <vector>

template <typename T>
T calculateAverage(const std::vector<T>& arr) {
    T sum = 0;
    for (const auto& element : arr) {
        sum += element;
    }

    return sum / static_cast<T>(arr.size());
}

int main() {
    // Пример использования функции для массива целых чисел
    std::vector<int> intArray = {1, 2, 3, 4, 5};
    int averageInt = calculateAverage(intArray);
    std::cout << "Среднее арифметическое целых чисел: " << averageInt << std::endl;

    // Пример использования функции для массива чисел с плавающей запятой
    std::vector<double> doubleArray = {1.5, 2.5, 3.5, 4.5, 5.5};
    double averageDouble = calculateAverage(doubleArray);
    std::cout << "Среднее арифметическое чисел с плавающей запятой: " << averageDouble << std::endl;

    return 0;
}

